const timer = ms => new Promise(res => setTimeout(res, ms));

async function avatarLoader() {
    let waitFor = 100;
    let shuffledAvatars = shuffle(avatars);
    for (let i = 0; i < shuffledAvatars.length; i++) {
        if (JSON.parse(localStorage.getItem('isLoading'))) {
            document.getElementById("avatar").src = shuffledAvatars[i];
            await timer(waitFor);
            waitFor = waitFor - 4;
            if (shuffledAvatars.length - 1 === i) {
                i = 0;
                waitFor = 100;
                shuffledAvatars = shuffle(avatars);
            }
        }
    }
}

function shuffle(array) {
    for (let i = array.length - 1; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        [array[i], array[j]] = [array[j], array[i]];
    }
    return array;
}